import React from "react";
import { Paper, Grid } from "@material-ui/core";
import billboardPic from "../images/k.jpg";
function Profile() {
  return (
    <Paper>
      <Grid container style={{ height: "100vh" }}>
        <Grid item xs={2}></Grid>
        <Grid item xs={8}>
          <img
            className=""
            style={{
              position: "relative",
              objectFit: "contain",
              width: "100%",
              borderRadius: "0px",
              borderBottomLeftRadius: "5px",
              borderBottomRightRadius: "5px",
              margin: "auto",
            }}
            src={billboardPic}
            alt="Superstarz Billboard Image"
          />
        </Grid>
      </Grid>
    </Paper>
  );
}

export default Profile;
